export default function Login({ onLogin }) {
  return (
    <div className="h-screen flex items-center justify-center bg-gradient-to-br from-slate-800 to-slate-900">
      <div className="bg-white p-8 rounded-2xl shadow-xl w-96 fade-in">
        <h2 className="text-2xl font-bold text-center mb-2">üçΩ FoodDash</h2>
        <p className="text-center text-gray-500 mb-6">
          Sign in to continue
        </p>

        {["nick", "marvel", "thanos"].map(u => (
          <button
            key={u}
            onClick={() => onLogin(u)}
            className="w-full mb-3 bg-slate-800 hover:bg-slate-900 text-white py-2 rounded-lg transition"
          >
            Login as {u}
          </button>
        ))}
      </div>
    </div>
  );
}
